export const changeName = (name) =>{
    window.name = name;
}

export const getName = () =>{
    return window.name;
}

export const setRecipe = (recipe) =>{
    window.recipe = recipe;
}

export const getRecipe = () =>{
    return window.recipe;
}

export const setFavorite = (favorite) =>{
    window.favorite = favorite;
}

export const getFavorite = () => {
    return window.favorite
}

export const setPantry = (pantry) =>{
    window.pantry = pantry;
}

export const getPantry = () => {
    return window.pantry;
}

export const setRestrictions = (restrictions) =>{
    window.restrictions = restrictions;
}

export const getRestrictions = () => {
    return window.restrictions;
}

export const setSuggestions = (suggestions) =>{
    window.suggestions = suggestions;
}

export const getSuggestions = () =>{
    return window.suggestions;
}

export const getUser = () => {
    return "User";
}

export const getAutoFill1 = () => {
    return ["test1", "test2", "test3", "test4"];
}

export const getAutoFill2 = () => {
    return ["apple1", "apple2", "apple3", "apple4"];
}
